import logo from "./logo.svg";
import "./App.css";
import axios from "axios";
const hash = "c41cec366ac6c477f37e5a15e5717be2";

function App() {
  const getCharacterList = () => {
    const url =
      "http://gateway.marvel.com/v1/public/characters?ts=100&apikey=57c07708bb14e463126483f2889b35eb&hash=c41cec366ac6c477f37e5a15e5717be2";

    axios
      .get(url)
      .then((response) => {
        console.log("haha response", response);
      })
      .catch((error) => {
        console.log("Error marvel: ", error);
      });
  };
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn Reactss
        </a>
      </header>
    </div>
  );
}

export default App;
